// SPDX-License-Identifier: MIT
// compiler version must be greater than or equal to 0.8.17 and less than 0.9.0
pragma solidity ^0.8.17;

contract BasicCalculator {

    uint256[] public pastResults;

    function addOnlyPositive(uint256 num1, uint256 num2) public returns(uint256) {
        require(num1 > 0, "Only Non-Zero and Positive Numbers are allowed");
        require(num2 > 0, "Only Non-Zero and Positive Numbers are allowed");

        uint256 result = num1 + num2;
        assert(result >= num1);

        // Add result to last result
        pastResults.push(result);

        return result;
    }

    function subtractOnlyPositive(uint256 num1, uint256 num2) public returns(uint256) {
        require(num1 >= num2, "num1 must be greater than or equal to num2");

        uint256 result = num1 - num2;
        assert((num2 >= 0 && result <= num1) || (num2 < 0 && result > num1));

        // Add result to last result
        pastResults.push(result);

        return result;
    }

    function multiplyOnlyPositive(uint256 num1, uint256 num2) public returns(uint256) {
        require(num1 > 0, "Only Non-Zero and Positive Numbers are allowed");
        require(num2 > 0, "Only Non-Zero and Positive Numbers are allowed");

        uint256 result = num1 * num2;
        assert(num1 == 0 || result / num1 == num2);

        // Add result to last result
        pastResults.push(result);

        return result;
    }

    function divideNum(uint256 num1, uint256 num2) public returns(uint256) {
        // Ensure num2 is not zero
        require(num2 != 0, "Cannot divide by zero");

        uint256 result = num1 / num2;

        // Add result to last result
        pastResults.push(result);

        return result;
    }

    function execTwoOp(uint8 op1, uint8 op2, uint256 num1, uint256 num2) public returns(uint256) {

        uint256 initialPastResultLength = pastResults.length;
        uint256 lastResult = 0;
        uint256 finalResult = 0;

        // Perform first operation
        if (op1 == 1) {
            lastResult = addOnlyPositive(num1, num2);
        } else if (op1 == 2) {
            lastResult = subtractOnlyPositive(num1, num2);
        } else if (op1 == 3) {
            lastResult = multiplyOnlyPositive(num1, num2);
        } else if (op1 == 4) {
            lastResult = divideNum(num1, num2);
        } else {
            revert("Invalid operation");
        }

        // If past results did not increase, revert, since operation may not be successful
        if ( pastResults.length != initialPastResultLength + 1 ) {
            revert("Past Result did not increment, operation may be unsuccessful");
        }

        // Perform second operation using lastResult
        if (op2 == 1) {
            finalResult = addOnlyPositive(lastResult, num2);
        } else if (op2 == 2) {

            if (lastResult < num2) {
                revert("The value of lastResult must be bigger than num2");
            }

            finalResult = subtractOnlyPositive(lastResult, num2);
        } else if (op2 == 3) {
            finalResult = multiplyOnlyPositive(lastResult, num2);
        } else if (op2 == 4) {
            finalResult = divideNum(lastResult, num2);
        } else {
            revert("Invalid operation");
        }

        // If past results did not increase, revert, since operation may not be successful
        if ( pastResults.length != initialPastResultLength + 2 ) {
            revert("Past Result did not increment, operation may be unsuccessful");
        }

        return finalResult;

    }

    function clearPastResults() public  {
        delete pastResults;
    }
}
